import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardMedia,
  Button,
  useTheme,
} from '@mui/material';
import {
  CameraAlt,
  LocalShipping,
  MenuBook,
  Science,
  Toys,
  HomeWork,
} from '@mui/icons-material';

const categories = [
  {
    id: 1,
    name: 'Telescopes & Accessories',
    description: 'Premium telescopes from ₹3,999 to ₹32,999 for all skill levels',
    icon: <CameraAlt sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1579532537598-459ecdaf39cc?auto=format&fit=crop&w=1024&q=80',
    link: '/products?category=telescopes',
    color: 'primary.main',
  },
  {
    id: 2,
    name: 'Space Merchandise',
    description: 'NASA apparel and collectibles starting from ₹999',
    icon: <LocalShipping sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1517976487492-5750f3195933?auto=format&fit=crop&w=1024&q=80',
    link: '/products?category=merchandise',
    color: 'cosmic.nebula',
  },
  {
    id: 3,
    name: 'Books & Education',
    description: 'Astronomy guides and star charts from ₹799',
    icon: <MenuBook sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1614935151651-0bea6508db6b?auto=format&fit=crop&w=1024&q=80',
    link: '/products?category=books',
    color: 'cosmic.star',
  },
  {
    id: 4,
    name: 'Home & Lifestyle',
    description: 'Galaxy projectors and space decor from ₹1,999',
    icon: <HomeWork sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1506318137071-a8e063b4bec0?auto=format&fit=crop&w=1024&q=80',
    link: '/products?category=home',
    color: 'cosmic.galaxy',
  },
  {
    id: 5,
    name: 'Gadgets & Kits',
    description: 'Smart telescopes and DIY kits from ₹3,499',
    icon: <Toys sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1446776811953-b23d57bd21aa?auto=format&fit=crop&w=1024&q=80',
    link: '/products?category=gadgets',
    color: 'cosmic.meteor',
  },
  {
    id: 6,
    name: 'Collectibles',
    description: 'Space shuttle models and meteorite fragments from ₹2,999',
    icon: <Science sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1534293230397-c067fc201ab8?auto=format&fit=crop&w=1024&q=80',
    link: '/products?category=collectibles',
    color: 'primary.light',
  },
];

const Home = () => {
  const navigate = useNavigate();
  const theme = useTheme();

  return (
    <Box>
      {/* Hero Section */}
      <Box
        sx={{
          position: 'relative',
          height: '70vh',
          display: 'flex',
          alignItems: 'center',
          overflow: 'hidden',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            background: 'url(https://images.unsplash.com/photo-1462331940025-496dfbfc7564?auto=format&fit=crop&w=2000&q=80) center/cover no-repeat',
            filter: 'brightness(0.4)',
            zIndex: -1,
          },
        }}
      >
        <Container maxWidth="lg">
          <Box sx={{ maxWidth: 600 }}>
            <Typography
              variant="h1"
              sx={{
                fontSize: { xs: '2.5rem', md: '4rem' },
                fontWeight: 700,
                color: 'primary.main',
                mb: 2,
                textShadow: '2px 2px 4px rgba(0,0,0,0.5)',
              }}
            >
              Explore the Cosmos
            </Typography>
            <Typography
              variant="h5"
              sx={{
                color: 'text.secondary',
                mb: 4,
                textShadow: '1px 1px 2px rgba(0,0,0,0.5)',
              }}
            >
              Your one-stop shop for astronomical equipment and space merchandise
            </Typography>
            <Button
              variant="contained"
              size="large"
              onClick={() => navigate('/products')}
              sx={{
                py: 2,
                px: 4,
                fontSize: '1.1rem',
                background: `linear-gradient(45deg, ${theme.palette.primary.main} 30%, ${theme.palette.primary.light} 90%)`,
                boxShadow: `0 3px 10px ${theme.palette.primary.main}40`,
                '&:hover': {
                  background: `linear-gradient(45deg, ${theme.palette.primary.light} 30%, ${theme.palette.primary.main} 90%)`,
                  transform: 'translateY(-2px)',
                  boxShadow: `0 5px 15px ${theme.palette.primary.main}60`,
                },
              }}
            >
              Shop Now
            </Button>
          </Box>
        </Container>
      </Box>

      {/* Categories Section */}
      <Container maxWidth="lg" sx={{ py: 8 }}>
        <Typography
          variant="h2"
          sx={{
            textAlign: 'center',
            mb: 6,
            color: 'text.primary',
            fontSize: { xs: '2rem', md: '3rem' },
          }}
        >
          Featured Categories
        </Typography>
        <Grid container spacing={4}>
          {categories.map((category) => (
            <Grid item key={category.id} xs={12} sm={6} md={4}>
              <Card
                onClick={() => navigate(category.link)}
                sx={{
                  height: '100%',
                  cursor: 'pointer',
                  position: 'relative',
                  overflow: 'hidden',
                  '&:hover': {
                    '& .MuiCardMedia-root': {
                      transform: 'scale(1.1)',
                    },
                    '& .category-content': {
                      background: `linear-gradient(to top, ${theme.palette.background.paper} 0%, transparent 100%)`,
                    },
                  },
                }}
              >
                <CardMedia
                  component="img"
                  height="280"
                  image={category.image}
                  alt={category.name}
                  sx={{
                    transition: 'transform 0.3s ease-in-out',
                  }}
                />
                <CardContent
                  className="category-content"
                  sx={{
                    position: 'absolute',
                    bottom: 0,
                    left: 0,
                    right: 0,
                    background: `linear-gradient(to top, ${theme.palette.background.default} 0%, transparent 100%)`,
                    transition: 'background 0.3s ease-in-out',
                    p: 3,
                  }}
                >
                  <Box
                    sx={{
                      display: 'flex',
                      alignItems: 'center',
                      gap: 2,
                      mb: 1,
                    }}
                  >
                    <Box sx={{ color: category.color }}>{category.icon}</Box>
                    <Typography variant="h5" sx={{ color: 'text.primary' }}>
                      {category.name}
                    </Typography>
                  </Box>
                  <Typography variant="body1" sx={{ color: 'text.secondary' }}>
                    {category.description}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>

      {/* Featured Products Banner */}
      <Box
        sx={{
          bgcolor: 'background.paper',
          py: 8,
          position: 'relative',
          overflow: 'hidden',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            background: `linear-gradient(45deg, ${theme.palette.cosmic.nebula}20 0%, ${theme.palette.cosmic.galaxy}20 100%)`,
            zIndex: 0,
          },
        }}
      >
        <Container maxWidth="lg" sx={{ position: 'relative', zIndex: 1 }}>
          <Grid container spacing={4} alignItems="center">
            <Grid item xs={12} md={6}>
              <Typography
                variant="h3"
                sx={{
                  color: 'primary.main',
                  mb: 2,
                  textShadow: '1px 1px 2px rgba(0,0,0,0.3)',
                }}
              >
                Featured Products
              </Typography>
              <Typography
                variant="h6"
                sx={{ color: 'text.secondary', mb: 3 }}
              >
                Explore our featured telescopes, including the Matrix Phoenix Refractor (₹3,999) and Celestron AstroMaster Motor Drive (₹32,999)
              </Typography>
              <Button
                variant="outlined"
                size="large"
                onClick={() => navigate('/products')}
                sx={{
                  borderColor: 'primary.main',
                  color: 'primary.main',
                  '&:hover': {
                    borderColor: 'primary.light',
                    backgroundColor: 'primary.main',
                    color: 'background.default',
                  },
                }}
              >
                View Collection
              </Button>
            </Grid>
            <Grid item xs={12} md={6}>
              <Box
                sx={{
                  display: 'grid',
                  gridTemplateColumns: 'repeat(2, 1fr)',
                  gap: 2,
                }}
              >
                {[1, 2, 3, 4].map((item) => (
                  <Box
                    key={item}
                    sx={{
                      height: 180,
                      bgcolor: 'background.default',
                      borderRadius: 2,
                      overflow: 'hidden',
                    }}
                  >
                    <img
                      src={`https://images.unsplash.com/photo-${1514000000000 + item}?auto=format&fit=crop&w=600&q=80`}
                      alt={`Featured ${item}`}
                      style={{
                        width: '100%',
                        height: '100%',
                        objectFit: 'cover',
                      }}
                    />
                  </Box>
                ))}
              </Box>
            </Grid>
          </Grid>
        </Container>
      </Box>
    </Box>
  );
};

